3-Did you know, New Zealand's giant wetapunga managed to outlive the dinosaurs🦕? 

Now these big insects are on the brink of extinction. 

@AJEarthrise visits a breeding programme in @aucklandzoo that’s saving this dinosaur-era insect back from extinction https://t.co/6OhnU9sRfR https://t.co/Rl0x5ujl3L

5- Some 𝟲𝟬% 𝗼𝗳 𝘁𝗵𝗲 𝘄𝗼𝗿𝗹𝗱’𝘀 𝗮𝗻𝗶𝗺𝗮𝗹𝘀 have been wiped out since the 1970s. 

A worldwide movement is now under way to "rewild" the countryside. 

@AJEarthrise travels to Patagonia where a couple spent $345m buying land for restoration https://t.co/kr0IljHAEU https://t.co/SflQx0Nk8y
